INSERT INTO `artikel` (`artikel_id`, `artikel_title_slug`, `artikel_title`, `artikel_konten`, `artikel_ketegori`, `artikel_tags`, `artikel_topik`, `artikel_tanggal`, `artikel_tanggal_diperbaharui`, `artikel_author`, `artikel_foto`, `artikel_hits`, `artikel_status`) VALUES
(4, 'pembiayaan-dengan-akad-syariah-kini-telah-hadir-di-koperasi', 'Pembiayaan dengan Akad Syariah Kini Telah Hadir di Koperasi', '<p>Demi memahami dan melayani anggota dalam memenuhi kebutuhannya dan mencapai kesejahteraannya, Koperasi ADI terus berupa melakukan berbagai pengembangan. Sebagai salah satu lembaga keuangan, pengembangan juga dilakukan di unit simpan pinjam. Unit simpan pinjam di Koperasi ADI khususnya pada produk pembiayaan kini menggunakan sistem bagi hasil, yang dinilai meminimalkan praktik riba dalam transaksi keuangan.</p>\r\n<p>Akad yang digunakan berupa :</p>\r\n<ul>\r\n<li>Ijarah multijasa (pendidikan, renovasi rumah, berobat, dll.)</li>\r\n<li>Murabahah (pembelian barang)</li>\r\n<li>Mudharabah (modal usaha)</li>\r\n</ul>\r\n<p>Diharapkan dengan adanya produk pembiayaan berbasis bagi hasil ini dapat mempermudah&nbsp; anggota Koperasi ADI dalam memenuhi kebutuhannya dan meningkatkan peran aktif anggota dalam bertransaksi di Koperasi ADI.</p>', 'Blog', 'koperasi, syariah, pembiayaan', 'Berita Terbaru', '2023-02-17 10:47:21', '2023-02-17 10:47:21', 'admin', 'pembiayaan-dengan-akad-syariah-kini-telah-hadir-di-koperasi.jpg', 4, 'publish'),
(5, 'pelayanan-simpan-pinjam-koperasi-di-masa-pandemi', 'Pelayanan Simpan Pinjam Koperasi di Masa Pandemi', '<p>Bagi anggota yang ingin menarik simpanan sukarela/ tabungan serta produk simpanan lainnya, akan dilayani dengan mekanisme sebagai berikut :</p>\r\n<ul>\r\n<li>Secara Tunai/Kantor :</li>\r\n</ul>\r\n<ol>\r\n<li>Konfirmasi via Whatsapp di nomor 0822-2724-2474 atau 0812-2987-9996</li>\r\n<li>Pelayanan Kantor Koperasi ADI dilayani pada hari Senin sampai Kamis, pukul 08.00 sampai 14.00 WIB dan hari jumat, sampai pukul 11.00 serta hari sabtu, sampai pukul 13.00 WIB</li>\r\n</ol>\r\n<ul>\r\n<li>Secara Online/Transfer :</li>\r\n</ul>\r\n<ol>\r\n<li>Konfirmasi via Whatsapp di nomor 0822-2724-2474 atau 0812-2987-9996</li>\r\n<li>Anggota mengisi formulir lewat link berikut :&nbsp;<a href=\"https://forms.gle/BrYA2WajzCE6h5Pa9\">Google Form</a></li>\r\n<li>Dana akan dikirim via transfer dan biaya transfer ditanggung oleh anggota</li>\r\n</ol>', 'Blog', 'koperasi, pandemi', 'Berita Terbaru', '2023-02-17 10:53:50', '2023-02-17 10:55:42', 'admin', 'pelayanan-simpan-pinjam-koperasi-di-masa-pandemi.jpg', 12, 'publish'),
(6, 'pendaftaran-menjadi-anggota-baru-secara-online', 'Pendaftaran Menjadi Anggota Baru Secara Online', '<p style=\"box-sizing: inherit; margin: 0px 0px 1.5em; padding: 0px; color: #333333; font-family: \'Libre Franklin\', \'Helvetica Neue\', helvetica, arial, sans-serif; font-size: 16px; background-color: #ffffff;\">Ditujukan kepada Dosen/Karyawan yang ingin mendaftarkan menjadi Anggota Koperasi secara online silahkan isi formulirnya di para link berikut: <a style=\"box-sizing: inherit; background-color: transparent; color: #222222; text-decoration-line: none; box-shadow: #0f0f0f 0px -1px 0px inset; transition: color 80ms ease-in 0s, box-shadow 130ms ease-in-out 0s, -webkit-box-shadow 130ms ease-in-out 0s;\" href=\"https://forms.gle/Usdq7wiXmCmcwjdk9\">Pendaftaran Anggota Baru</a></p>\r\n<p style=\"box-sizing: inherit; margin: 0px 0px 1.5em; padding: 0px; color: #333333; font-family: \'Libre Franklin\', \'Helvetica Neue\', helvetica, arial, sans-serif; font-size: 16px; background-color: #ffffff;\">Formulir akan diterima setiap bulannya. Pendaftaran setelah tgl 10 tiap bulannya akan dimasukkan ke bulan berikutnya.</p>', 'Blog', 'anggota, pendaftaran', 'Berita Terbaru', '2023-02-17 10:53:50', '2023-02-17 10:53:50', 'admin', 'pendaftaran-menjadi-anggota-baru-secara-online.jpg', 5, 'publish'),
