(10, 'tentang-kami', 'Tentang Kami', '<h3 style=\"box-sizing: border-box; font-family: -apple-system, \'system-ui\', \'Segoe UI\', Roboto, Helvetica, Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-weight: 400; line-height: 1.1; color: #333333; margin-top: 20px; margin-bottom: 10px; font-size: 26px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; vertical-align: inherit;\">Mereka memberikan kesenangan yang paling berharga, seolah-olah kesenangan tubuh harus diterima.</span></h3>\r\n<p class=\"fst-italic\" style=\"box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-family: -apple-system, \'system-ui\', \'Segoe UI\', Roboto, Helvetica, Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; vertical-align: inherit;\">Penting untuk merawat pasien, diikuti oleh dokter, tetapi ini adalah saat yang sangat menyakitkan dan menderita.</span></p>\r\n<ul style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; list-style: none; padding: 0px; color: #333333; font-family: -apple-system, \'system-ui\', \'Segoe UI\', Roboto, Helvetica, Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\">\r\n<li style=\"box-sizing: border-box; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; vertical-align: inherit;\">Ullamco laboris diperlukan dan aliquip ex dan consequat yang nyaman.</span></li>\r\n<li style=\"box-sizing: border-box; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; vertical-align: inherit;\">Keraguan atau irrure rasa sakit di tegur dalam kesenangan yang dia inginkan.</span></li>\r\n<li style=\"box-sizing: border-box; padding-bottom: 10px;\"><span style=\"box-sizing: border-box; vertical-align: inherit;\"><span style=\"box-sizing: border-box; vertical-align: inherit;\">Saya tidak bekerja sama sekali kecuali untuk mendapatkan beberapa keuntungan darinya.&nbsp;</span><span style=\"box-sizing: border-box; vertical-align: inherit;\">Duis aureur irure pain in reprehendit in pleasure tridetas storacalaperda mastir pain eu fu no be born.</span></span></li>\r\n</ul>\r\n<p style=\"box-sizing: border-box; margin: 0px; color: #333333; font-family: -apple-system, \'system-ui\', \'Segoe UI\', Roboto, Helvetica, Arial, sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\'; font-size: 15px; background-color: #ffffff;\"><span style=\"box-sizing: border-box; vertical-align: inherit;\"><span style=\"box-sizing: border-box; vertical-align: inherit;\">Saya tidak bekerja sama sekali kecuali untuk mendapatkan beberapa keuntungan darinya.&nbsp;</span><span style=\"box-sizing: border-box; vertical-align: inherit;\">Jangan marah sakit di tegur di senang dia mau sehelai rambut sakit dengan harapan tidak ada pembiakan.&nbsp;</span><span style=\"box-sizing: border-box; vertical-align: inherit;\">Kecuali mereka dibutakan oleh nafsu, mereka tidak keluar, mereka bersalah yang meninggalkan tugasnya, jiwa menjadi lembut, itulah kerja keras</span></span></p>', 'Page', '', '', '2023-03-06 08:59:07', '2023-03-06 08:59:07', 'admin', '', 0, 'publish');
